(1486, 422, '_wp_attachment_metadata', 'a:10:{s:8:\"filesize\";i:988226;s:9:\"mime_type\";s:9:\"video/mp4\";s:6:\"length\";i:4;s:16:\"length_formatted\";s:4:\"0:04\";s:5:\"width\";i:720;s:6:\"height\";i:1396;s:10:\"fileformat\";s:3:\"mp4\";s:10:\"dataformat\";s:9:\"quicktime\";s:5:\"audio\";a:7:{s:10:\"dataformat\";s:3:\"mp4\";s:5:\"codec\";s:19:\"ISO/IEC 14496-3 AAC\";s:11:\"sample_rate\";d:44100;s:8:\"channels\";i:2;s:15:\"bits_per_sample\";i:16;s:8:\"lossless\";b:0;s:11:\"channelmode\";s:6:\"stereo\";}s:17:\"created_timestamp\";i:-2082844800;}'),
(1488, 326, '_elementor_data', '[{\"id\":\"1233fc77\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7e725b38\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"28fa9f29\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<span style=\\\"color: #ffffff;\\\">No cuento con muchos hobbies, pero los pocos que tengo los disfruto much\\u00edsimo.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">El primero es la lectura. El primer libro que le\\u00ed fue \\\"El diario de Ana Frank\\\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ah\\u00ed cuando me gust\\u00f3 leer, aunque disfrut\\u00e9 de el libro. Fue durante el primer a\\u00f1o de secundaria que una amiga me prest\\u00f3 el libro de \\\"Bajo la misma estrella\\\". Ese libro me gust\\u00f3 much\\u00edsimo y fue as\\u00ed como entr\\u00e9 al mundo de la lectura, de ese libro le siguieron muchos m\\u00e1s, sobre todo novelas o libros de suspenso.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Entre mis libros favoritos est\\u00e1n: La selecci\\u00f3n, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros m\\u00e1s.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Yo no considero que debas leer un tipo de libro en espec\\u00edfico, cualquier libro que desees leer es una buena opci\\u00f3n ya que la lectura te trae muchos beneficios como reducci\\u00f3n del estr\\u00e9s, estimulaci\\u00f3n de el razonamiento\\u00a0y la capacidad\\u00a0memor\\u00edstica de las personas, adem\\u00e1s de que te ayudar\\u00e1 a ampliar tu vocabulario.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Orgullo y Prejuicio por ejemplo, para m\\u00ed ha sido el libro m\\u00e1s complicado que he le\\u00eddo, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconoc\\u00eda, adem\\u00e1s de expresiones un tanto extra\\u00f1as que jam\\u00e1s hab\\u00eda escuchado. Por lo que, para continuar con la lectura y comprenderla, ten\\u00eda que investigar su significado, y es as\\u00ed como fui almacenando m\\u00e1s palabras nuevas en mi vocabulario.<\\/span>\\r\\n\\r\\n[gallery columns=\\\"4\\\" size=\\\"medium\\\" ids=\\\"327,328,329,330\\\"]\\r\\n\\r\\n&nbsp;\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">El segundo de mis hobbies, es el que m\\u00e1s hago con demasiada frecuencia: escuchar m\\u00fasica.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Escucho m\\u00fasica todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.<\\/span>\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Actualmente disfruto de un \\u00e1lbum en espec\\u00edfico, Lover de Taylor Swift. Todas las canciones de ese \\u00e1lbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=VsKoOH6DVys\\\">London Boy<\\/a>, <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=8zdg-pDF10g\\\">Paper Rings<\\/a>, <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=GTEFSuFfgnU\\\">Death By A Thousand Cuts<\\/a>, <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=VikHHWrgb4Y\\\">Cornelia Street<\\/a> y <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=2d1wKn-oJnA\\\">I Think He Knows<\\/a>.<\\/span>\\r\\n\\r\\n<img class=\\\"size-medium wp-image-331 aligncenter\\\" src=\\\"http:\\/\\/anneluresti.me\\/wp-blog2\\/wp-content\\/uploads\\/2019\\/11\\/602577928680-300x300.jpg\\\" alt=\\\"\\\" width=\\\"300\\\" height=\\\"300\\\" \\/>\\r\\n\\r\\n&nbsp;\\r\\n\\r\\n<span style=\\\"color: #ffffff;\\\">Adem\\u00e1s de las ya mencionadas canciones, otras de mis favoritas del momento son:<a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=zlJDTxahav0\\\"> Lose You To Love Me<\\/a> de Selena Gomez y <a style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.youtube.com\\/watch?v=EQ51hgSxEaI\\\">Only Human<\\/a> de Jonas Brothers.<\\/span>\\r\\n\\r\\n&nbsp;\\r\\n\\r\\n[gallery columns=\\\"2\\\" size=\\\"medium\\\" ids=\\\"332,333\\\"]\\r\\n\\r\\n&nbsp;\\r\\n\\r\\n&nbsp;\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"282138d\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong><span style=\\\"color: #000000;\\\">El siguiente video es una presentaci\\u00f3n de mi artista favorita, Taylor Swift, espero sea de tu agrado!<\\/span><\\/strong><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"99da7f5\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"2c5c692\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"5c0fd7d\",\"elType\":\"widget\",\"settings\":{\"youtube_url\":\"https:\\/\\/www.youtube.com\\/watch?v=eIRCskNRTDY\",\"vimeo_url\":\"https:\\/\\/vimeo.com\\/235215203\",\"dailymotion_url\":\"https:\\/\\/www.dailymotion.com\\/video\\/x6tqhqb\",\"_border_radius\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"video\"}],\"isInner\":false}],\"isInner\":false}]'),
