iable</h2><!--  /.service-title -->\n		                	<p>Trabajamos de manera eficaz y eficiente para brindar un mejor servicio.</p>\n		            	<!--  /.service-content -->\n		            		<ul><li>Info. Diseño Gráfico</li><li>Diseño UI/UX </li><li>Diseño de marca</li><li>Elementos UI</li><li>Diseño de Animación 3D  </li><li>Diseño Web </li></ul>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n		            			            <!--  /.service-icon -->\n		            		            <h2>Soporte premium</h2><!--  /.service-title -->\n		                	<p>Contamos con un excelente soporte técnico para el cliente sobre dudas y aclaraciones.</p>\n		            	<!--  /.service-content -->\n		            		<ul><li>Info. Diseño Gráfico</li><li>Diseño UI/UX </li><li>Diseño de marca</li><li>Elementos UI</li><li>Diseño de Animación 3D  </li><li>Diseño Web </li></ul>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n					<!--  /.owl-carousel -->\n			            <h2>02</h2><!--  /.title-counter -->\n        	        	            <h2>Acerca de mí</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n			<h2>Annel Uresti</h2>		\n		<p>Mis conocimientos actuales los obtuve desde mi educación media superior. Y actualmente me encuentro en mi primer cuatrimestre de la Ing. en Tecnologías de la Información.</p>		\n		        <h4>\n		        			            Estrategia\n		                    94%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Marketing\n		                    85%\n		        </h4>\n		    <!-- /.skill-bar -->\n		       