4><!--  /.client-name -->\n		                            <!--  /.client-detail -->\n		                        			                        <!--  /.client-area -->\n		                            <p>Annel y su equipo, siempre son mi primera opción para casi cualquier proyecto que desee realizar.</p>		                        <!--  /.details -->\n		                    			                    <!--  /.testimonial-details -->\n		                <!--  /.client-testimonial -->\n		            <!--  /.item -->\n		                        <img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-2-100x100.jpg\" alt=\"Kervan Cardona\" />\n		                    <!--  /.client-thumb -->\n		                                <h4>Kervan Cardona</h4><!--  /.client-name -->\n		                            <!--  /.client-detail -->\n		                        			                        <!--  /.client-area -->\n		                            <p>Su equipo y ella me han demostrado que son profesionales, cumplen en tiempo y forma siempre.</p>		                        <!--  /.details -->\n		                    			                    <!--  /.testimonial-details -->\n		                <!--  /.client-testimonial -->\n		            <!--  /.item -->\n		        <!--  /.owl-carousel -->\n		    <!--  /.col-md-10 -->\n		<!--  /.row -->\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"96\" height=\"97\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/01/logo-1.png\" alt=\"\" />								</a>\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"150\" height=\"150\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png 150w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-