(285, 1, '2019-11-06 01:28:13', '2019-11-06 01:28:13', '<span style=\"color: #ffffff;\">Mi nombre es Annel Fernanda Uresti Barrón, nací y crecí en Cd. Victoria, Tamaulipas. Mi primer contacto con los temas relacionados a la programación, fue en primero de secundaria, en el taller de Informática en el que estuve 3 años y después estudié Programación en mi educación media superior,  con un enfoque más claro a seguir con la Programación. Actualmente estudio en la Universidad Politécnica de Victoria en la carrera de Ing. en Tecnologías de la Información.</span>\r\n\r\n<span style=\"color: #ffffff;\">Para saber más sobre mí, como mis gustos y mi familia, puedes dirigirte al menú superior del lado derecho, llamado \"Acerca de mí\" y escoger el tema de tu interés.</span>\r\n\r\n&nbsp;\r\n\r\n<img class=\"aligncenter wp-image-288 size-medium\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190315_154306-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" />', 'Acerca de mí', '', 'publish', 'closed', 'closed', '', 'acerca-de-mi', '', '', '2019-11-15 01:14:31', '2019-11-15 01:14:31', '', 0, 'http://anneluresti.me/wp-blog2/?page_id=285', 0, 'page', '', 0),
