(293, 1, '2019-11-06 01:35:08', '2019-11-06 01:35:08', '<span style=\"color: #ffffff;\">Mi nombre es Annel Fernanda Uresti Barrón, nací y crecí en Cd. Victoria, Tamaulipas. Mi primer contacto con los temas relacionados a la programación, fue en primero de secundaria, en el taller de Informática en el que estuve 3 años y después estudié Programación en mi educación media superior,  con un enfoque más claro a seguir con la Programación. Actualmente estudio en la Universidad Politécnica de Victoria en la carrera de Ing. en Tecnologías de la Información.</span>\r\n\r\n&nbsp;\r\n\r\n<img class=\"aligncenter wp-image-288 size-medium\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190315_154306-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" />', 'Acerca de mí', '', 'inherit', 'closed', 'closed', '', '285-revision-v1', '', '', '2019-11-06 01:35:08', '2019-11-06 01:35:08', '', 285, 'http://anneluresti.me/wp-blog2/?p=293', 0, 'revision', '', 0),
(294, 1, '2019-11-06 01:38:36', '2019-11-06 01:38:36', '<span style=\"color: #ffffff;\">Desde muy pequeña aprendí a ser <strong>rápida</strong>, que considero es una muy buena habilidad hoy en día. Ya que un cliente nos pide un proyecto con ciertas características y tenemos que saber administrar nuestro tiempo para poder terminar el trabajo antes de la entrega y poder hacer los últimos retoques y finalmente estregar un buen trabajo, bonito y con las características que nos fue solicitado.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-308 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/1542110228379_1-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Otra de las habilidades que considero me son de beneficio en este negocio es el<strong> trabajo en equipo</strong>. Yo no podría hacer esto sin mi equipo respaldándome. Por eso es importante tener un buen compañerismo entre todos los que somos parte de este equipo.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-306 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/como-puede-contribuir-la-tecnologia-al-trabajo-en-equipo--300x147.jpg\" alt=\"\" width=\"300\" height=\"147\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Cualquier negocio fallaría si no se tiene <strong>organización</strong><strong>. </strong>Esta habilidad la desarrollé a lo largo de los años, sobre todo en proyectos escolares, en los que te dicen el proyecto esperado y la fecha de entrega, por lo que se tiene que organizar el avance con el tiempo que resta para entregar.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-307 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/linkedin-cv-874x492-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" /></span>', 'Mis habilidades', '', 'publish', 'closed', 'closed', '', 'favoritos', '', '', '2019-11-06 16:06:12', '2019-11-06 16:06:12', '', 0, 'http://anneluresti.me/wp-blog2/?page_id=294', 0, 'page', '', 0),
