(301, 1, '2019-11-06 01:38:36', '2019-11-06 01:38:36', 'Mis películas favoritas son muy variadas, van desde romance hasta de terror. Entre mi top 3 están las siguentes:\r\n\r\n[gallery size=\"medium\" ids=\"295,296,297\"]\r\n\r\n&nbsp;\r\n\r\nDisfruto aún más de una buena serie, sobre todo una serie de comedia. Entre mi top 3 están las siguientes:\r\n\r\n[gallery size=\"medium\" ids=\"298,299,300\"]', 'Favoritos', '', 'inherit', 'closed', 'closed', '', '294-revision-v1', '', '', '2019-11-06 01:38:36', '2019-11-06 01:38:36', '', 294, 'http://anneluresti.me/wp-blog2/?p=301', 0, 'revision', '', 0),
(302, 1, '2019-11-06 02:50:52', '2019-11-06 02:50:52', '<span style=\"color: #ffffff;\">Desde muy pequeña aprendí a ser</span> rápida, que considero es una muy buena habilidad hoy en día. Ya que un cliente nos pide un proyecto con ciertas características y tenemos que saber administrar nuestro tiempo para poder terminar el trabajo antes de la entrega y poder hacer los últimos retoques y finalmente estregar un buen trabajo, bonito y con las características que nos fue solicitado.\n\n<img class=\"size-medium wp-image-308 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/1542110228379_1-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" />\n\nOtra de las habilidades que considero me son de beneficio en este negocio es el trabajo en equipo. Yo no podría hacer esto sin mi equipo respaldándome. Por eso es importante tener un buen compañerismo entre todos los que somos parte de este equipo.\n\n<img class=\"size-medium wp-image-306 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/como-puede-contribuir-la-tecnologia-al-trabajo-en-equipo--300x147.jpg\" alt=\"\" width=\"300\" height=\"147\" />\n\nCualquier negocio fallaría si no se tiene organización<strong>. </strong>Esta habilidad la desarrollé a lo largo de los años, sobre todo en proyectos escolares, en los que te dicen el proyecto esperado y la fecha de entrega, por lo que se tiene que organizar el avance con el tiempo que resta para entregar.\n\n<img class=\"size-medium wp-image-307 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/linkedin-cv-874x492-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" />', 'Mis habilidades', '', 'inherit', 'closed', 'closed', '', '294-autosave-v1', '', '', '2019-11-06 02:50:52', '2019-11-06 02:50:52', '', 294, 'http://anneluresti.me/wp-blog2/?p=302', 0, 'revision', '', 0),
