(309, 1, '2019-11-06 02:49:50', '2019-11-06 02:49:50', '<span style=\"color: #ffffff;\">Desde muy pequeña aprendí a ser</span> <span style=\"color: #00ffff;\">rápida</span><span style=\"color: #ffffff;\">, que considero es una muy buena habilidad hoy en día. Ya que un cliente nos pide un proyecto con ciertas características y tenemos que saber administrar nuestro tiempo para poder terminar el trabajo antes de la entrega y poder hacer los últimos retoques y finalmente estregar un buen trabajo, bonito y con las características que nos fue solicitado.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-308 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/1542110228379_1-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Otra de las habilidades que considero me son de beneficio en este negocio es el</span> <span style=\"color: #00ffff;\">trabajo en equipo</span><span style=\"color: #ffffff;\">. Yo no podría hacer esto sin mi equipo respaldándome. Por eso es importante tener un buen compañerismo entre todos los que somos parte de este equipo.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-306 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/como-puede-contribuir-la-tecnologia-al-trabajo-en-equipo--300x147.jpg\" alt=\"\" width=\"300\" height=\"147\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Cualquier negocio fallaría si no se tiene</span> <span style=\"color: #00ffff;\">organización</span><span style=\"color: #ffffff;\"><strong>. </strong>Esta habilidad la desarrollé a lo largo de los años, sobre todo en proyectos escolares, en los que te dicen el proyecto esperado y la fecha de entrega, por lo que se tiene que organizar el avance con el tiempo que resta para entregar.</span>\r\n\r\n<img class=\"size-medium wp-image-307 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/linkedin-cv-874x492-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" />', 'Mis habilidades', '', 'inherit', 'closed', 'closed', '', '294-revision-v1', '', '', '2019-11-06 02:49:50', '2019-11-06 02:49:50', '', 294, 'http://anneluresti.me/wp-blog2/?p=309', 0, 'revision', '', 0),
(310, 1, '2019-11-06 02:51:46', '2019-11-06 02:51:46', '<span style=\"color: #ffffff;\">Desde muy pequeña aprendí a ser</span> <strong><span style=\"color: #ffffff;\">rápida</span></strong><span style=\"color: #ffffff;\">, que considero es una muy buena habilidad hoy en día. Ya que un cliente nos pide un proyecto con ciertas características y tenemos que saber administrar nuestro tiempo para poder terminar el trabajo antes de la entrega y poder hacer los últimos retoques y finalmente estregar un buen trabajo, bonito y con las características que nos fue solicitado.</span>\r\n\r\n<img class=\"size-medium wp-image-308 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/1542110228379_1-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" />\r\n\r\n<span style=\"color: #ffffff;\">Otra de las habilidades que considero me son de beneficio en este negocio es el<strong> trabajo en equipo</strong>. Yo no podría hacer esto sin mi equipo respaldándome. Por eso es importante tener un buen compañerismo entre todos los que somos parte de este equipo.</span>\r\n\r\n<img class=\"size-medium wp-image-306 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/como-puede-contribuir-la-tecnologia-al-trabajo-en-equipo--300x147.jpg\" alt=\"\" width=\"300\" height=\"147\" />\r\n\r\n<span style=\"color: #ffffff;\">Cualquier negocio fallaría si no se tiene <strong>organización</strong><strong>. </strong>Esta habilidad la desarrollé a lo largo de los años, sobre todo en proyectos escolares, en los que te dicen el proyecto esperado y la fecha de entrega, por lo que se tiene que organizar el avance con el tiempo que resta para entregar.</span>\r\n\r\n<img class=\"size-medium wp-image-307 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/linkedin-cv-874x492-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" />', 'Mis habilidades', '', 'inherit', 'closed', 'closed', '', '294-revision-v1', '', '', '2019-11-06 02:51:46', '2019-11-06 02:51:46', '', 294, 'http://anneluresti.me/wp-blog2/?p=310', 0, 'revision', '', 0),
(311, 1, '2019-11-06 02:56:18', '2019-11-06 02:56:18', '<span style=\"color: #ffffff;\">Un factor de vital importancia para la creación de mi negocio de desarrollo de software fue mi familia. Yo soy la tercera hija de mis padres, Francisco Uresti y Laura Barrón. Mi hermano mayor se llama Gianfranco, a él le sigue mi hermana Daniela, después yo, y finalmente mi hermana menor Daneyla.</span>\r\n\r\n&nbsp;\r\n\r\n[gallery size=\"medium\" columns=\"2\" ids=\"312,313\"]\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Nunca fuimos muy cercanos a mis abuelas y a mi abuelo (mi abuelo por parte de mi papá falleció cuando el tenía 15 años), por lo que para mí, desde temprana edad siempre fuimos solamente nosotros seis como familia.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermano mayor Gianfranco actualmente está títulado como Ing. en Electrónica y reside desde hace más de un año en la ciudad de Monterrey, NL. Él es 7 años mayor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermana Daniela, está títulada como Ing. en Sistemas Computacionales y actualmente trabaja para Gobierno del Estado de Tamaulipas. Ella es 6 años mayor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermana Daneyla está cursando actualmente su último año de bachillerato en el CBTis 119. Ella es 1 año menor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Pero esta no es toda mi familia, para mí mi perro es parte de mi familia, ha estado con nosotros desde hace más de 6 años.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-314 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PicsArt_08-21-07.52.52-1-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" /></span>', 'Mi Familia', '', 'publish', 'closed', 'closed', '', 'mi-familia', '', '', '2019-11-06 16:05:34', '2019-11-06 16:05:34', '', 0, 'http://anneluresti.me/wp-blog2/?page_id=311', 0, 'page', '', 0),
