(315, 1, '2019-11-06 02:56:18', '2019-11-06 02:56:18', 'Un factor de vital importancia para la creación de mi negocio de desarrollo de software fue mi familia. Yo soy la tercera hija de mis padres, Francisco Uresti y Laura Barrón. Mi hermano mayor se llama Gianfranco, a él le sigue mi hermana Daniela, después yo, y finalmente mi hermana menor Daneyla.\r\n\r\n&nbsp;\r\n\r\n[gallery size=\"medium\" columns=\"2\" ids=\"312,313\"]\r\n\r\n&nbsp;\r\n\r\nNunca fuimos muy cercanos a mis abuelas y a mi abuelo (mi abuelo por parte de mi papá falleció cuando el tenía 15 años), por lo que para mí, desde temprana edad siempre fuimos solamente nosotros seis como familia.\r\n\r\nMi hermano mayor Gianfranco actualmente está títulado como Ing. en Electrónica y reside desde hace más de un año en la ciudad de Monterrey, NL. Él es 7 años mayor que yo.\r\n\r\nMi hermana Daniela, está títulada como Ing. en Sistemas Computacionales y actualmente trabaja para Gobierno del Estado de Tamaulipas. Ella es 6 años mayor que yo.\r\n\r\nMi hermana Daneyla está cursando actualmente su último año de bachillerato en el CBTis 119. Ella es 1 año menor que yo.\r\n\r\nPero esta no es toda mi familia, para mí mi perro es parte de mi familia, ha estado con nosotros desde hace más de 6 años.\r\n\r\n<img class=\"size-medium wp-image-314 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PicsArt_08-21-07.52.52-1-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" />', 'Mi Familia', '', 'inherit', 'closed', 'closed', '', '311-revision-v1', '', '', '2019-11-06 02:56:18', '2019-11-06 02:56:18', '', 311, 'http://anneluresti.me/wp-blog2/?p=315', 0, 'revision', '', 0),
(316, 1, '2019-11-06 03:01:40', '2019-11-06 03:01:40', '<span style=\"color: #ffffff;\">Yo tuve una gran educación desde el momento en que ingresé a nivel básico. A la edad de 3 años ingrese al Jardín de Niños \"Decroly\" en el que me enseñaron básicamente todo, leer, escribir y un poco de matemáticas básicas. La razón por la que ingresé a este jardín fue porque mis hermanos ya habían estado allí por lo que mi mamá conocía la manera en que enseñaban, y estaba feliz con los conocimientos que adquirieron mis hermanos durante su paso por el jardín.</span>\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"317,318\"]\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">En el año 2007 ingresé a la Primaria República de Chile, otra excelente escuela. Al ser una escuela de pocos alumnos, se tiene una educación más personalizada. Habían muchos excelentes maestros de los que todavía recuerdo con cariño, entre ellos al profesor Marco y la maestra Norma quienes sin duda amaban ser maestros y a sus alumnos. Nuevamente mi ingreso a esta escuela fue marcado por el previo conocimiento de mi mamá, de la escuela y sus maestros.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-319 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/20191105_152909-e1573009159782-300x203.jpg\" alt=\"\" width=\"300\" height=\"203\" /></span>\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">En 2013 ingresé a la secundaria Técnica No.1 \"Álvaro Obregón\". En este caso, solo mi hermano estudió aquí y me aconsejo que yo también debería de entrar allí ya que era una muy buena escuela. Y así lo hice, aunque nos quedaba más lejos que otras secundarias, mis papás me apoyaron en mi decisión de presentar en esa secundaria. Ingresé finalmente, en el turno matutino.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-320 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/20191105_172405-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" /></span>\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Así llegamos al año 2016, cuando finalmente ingresé al CBTis 271 que aunque no había sido mi primera opción estoy muy agradecida de que ingresé allí y no a otro. En este CBTis encontré a las que considero mis verdaderas amigas, como lo fuimos desde primer semestre hasta sexto. En él también nos encontramos con maestros que más que eso, eran amigos y nos apoyaban en todo. Sin duda la mejor época de mi vida.</span>\r\n\r\n[gallery columns=\"4\" size=\"medium\" ids=\"321,322,323,324\"]', 'Mis Estudios', '', 'publish', 'closed', 'closed', '', 'mis-estudios', '', '', '2019-11-06 16:07:05', '2019-11-06 16:07:05', '', 0, 'http://anneluresti.me/wp-blog2/?page_id=316', 0, 'page', '', 0),
