(334, 1, '2019-11-06 03:05:17', '2019-11-06 03:05:17', 'No cuento con muchos hobbies, pero los pocos que tengo los disfruto muchísimo.\r\n\r\nEl primero es la lectura. El primer libro que leí fue \"El diario de Ana Frank\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ahí cuando me gustó leer, aunque disfruté de el libro. Fue durante el primer año de secundaria que una amiga me prestó el libro de \"Bajo la misma estrella\". Ese libro me gustó muchísimo y fue así como entré al mundo de la lectura, de ese libro le siguieron muchos más, sobre todo novelas o libros de suspenso.\r\n\r\nEntre mis libros favoritos están: La selección, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros más.\r\n\r\nYo no considero que debas leer un tipo de libro en específico, cualquier libro que desees leer es una buena opción ya que la lectura te trae muchos beneficios como reducción del estrés, estimulación de el razonamiento y la capacidad memorística de las personas, además de que te ayudará a ampliar tu vocabulario.\r\n\r\nOrgullo y Prejuicio por ejemplo, para mí ha sido el libro más complicado que he leído, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconocía, además de expresiones un tanto extrañas que jamás había escuchado. Por lo que, para continuar con la lectura y comprenderla, tenía que investigar su significado, y es así como fui almacenando más palabras nuevas en mi vocabulario.\r\n\r\n[gallery columns=\"4\" size=\"medium\" ids=\"327,328,329,330\"]\r\n\r\n&nbsp;\r\n\r\nEl segundo de mis hobbies, es el que más hago con demasiada frecuencia: escuchar música.\r\n\r\nEscucho música todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.\r\n\r\nActualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son London Boy, Paper Rings, Death By A Thousand Cuts, Cornelia Street y I Think He Knows.\r\n\r\n<img class=\"size-medium wp-image-331 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\r\n\r\n&nbsp;\r\n\r\nAdemás de las ya mencionadas canciones, otras de mis favoritas del momento son: Lose You To Love Me de Selena Gomez y Only Human de Jonas Brothers.\r\n\r\n&nbsp;\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-06 03:05:17', '2019-11-06 03:05:17', '', 326, 'http://anneluresti.me/wp-blog2/?p=334', 0, 'revision', '', 0),
(335, 1, '2019-11-06 03:07:41', '2019-11-06 03:07:41', '<span style=\"color: #ffffff;\">Además de la familia, a veces necesitas otro tipo de apoyo o motivación para seguir adelante en el camino. En mi caso hay varias frases que he escuchado en series o películas, así como leído en libros, que me motivan a no rendirme.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Si tú no trabajas por tus sueños, alguien te contratará para que trabajes por los suyos\".</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">Esta frase es sin duda muy clara y directa, puedes ser un empleado más de alguien que si luchó y trabajó por sus sueños, o puedes ser tú quien luche por los suyos hasta que los haga realidad.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Solo una persona puede impedirte llegar muy alto y te mira todos los días desde el espejo\"</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">A veces nuestro peor enemigo somos nosotros mismos. Pero también somos nosotros mismos quienes decidimos qué pasará con nuestra vida más adelante, por lo que puedes irte por el camino fácil y destruir tú mismo tus sueños o puedes ponerte una meta muy clara y luchar día a día para llegar a ella.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Sé lo que tengo que hacer ahora, tengo que seguir respirando porque mañana el sol saldrá. ¿Quién sabe lo que podrá traer la marea?\" -Náufrago.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">La película de Náufrago es una clásica, tal vez no le dimos importancia a esta frase en su momento, pero ahora leyéndola, nos damos cuenta de que es muy cierta, el sol siempre saldrá, cada día es un nuevo comienzo, un paso más cerca a tu meta, por lo que tienes que \"seguir respirando\".</span>\r\n<span style=\"color: #ffffff;\"><img class=\"aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/059672.jpg-c_215_290_x-f_jpg-q_x-xxyxx.jpg\" alt=\"\" width=\"215\" height=\"290\" /></span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"No dejes nunca que alguien te haga sentir como si no te merecieras lo que quieres\".-10 razones para odiarte.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">En el camino a tus metas, puedes encontrarte con personas que te van a cuestionar \"¿eres suficientemente bueno?¿lo lograrás?\". No debes nunca permitir que alguien te haga dudar de tus metas, por el contrario, persigue esa meta y pruebale que lo lograste. Así eventualmente dejarás de escucharlos pues sabes que lograrás lo que sea que te propongas.</span>\r\n<span style=\"color: #ffffff;\"><img class=\"aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/jlXMEcAYOvu7s0QnWKE9q4P4pmN-689x1024-202x300.jpg\" alt=\"\" width=\"202\" height=\"300\" /></span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Si luchas, puedes perder. Si no luchas, ya has perdido\". –  Million Dollar Baby.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">El camino a tu meta no será fácil, tendrás muchos obstáculos que serán cada vez más difíciles de pasar, por lo que no te quedará más que luchar por lo que quieres cada día, y llegará un punto en el que pensarás en rendirte. Solo recuerda que si no luchas, habrás perdido ya la batalla al éxito.</span>\r\n<span style=\"color: #ffffff;\"><img class=\"aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/f2956af4c64042690b4cecb57b98a736-210x300.jpg\" alt=\"\" width=\"210\" height=\"300\" /></span>\r\n\r\n<span style=\"color: #ffffff;\"><strong>Te dejo una historia de superación que se hizo famosa al ser representada en la película En Busca de la Felicidad. Esta es la historia de Chris Gardner.</strong></span>\r\n\r\nhttps://www.youtube.com/watch?v=5OqnLHrQ8o8', 'Motivaciones', '', 'publish', 'closed', 'closed', '', 'motivaciones', '', '', '2019-11-18 21:04:15', '2019-11-18 21:04:15', '', 0, 'http://anneluresti.me/wp-blog2/?page_id=335', 0, 'page', '', 0),
