(338, 1, '2019-11-06 03:07:31', '2019-11-06 03:07:31', '', 'f2956af4c64042690b4cecb57b98a736', '', 'inherit', 'open', 'closed', '', 'f2956af4c64042690b4cecb57b98a736', '', '', '2019-11-06 03:07:31', '2019-11-06 03:07:31', '', 335, 'http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/f2956af4c64042690b4cecb57b98a736.jpg', 0, 'attachment', 'image/jpeg', 0),
(339, 1, '2019-11-06 03:07:41', '2019-11-06 03:07:41', 'Además de la familia, a veces necesitas otro tipo de apoyo o motivación para seguir adelante en el camino. En mi caso hay varias frases que he escuchado en series o películas, así como leído en libros, que me motivan a no rendirme.\r\n<ul>\r\n 	<li>\"Si tú no trabajas por tus sueños, alguien te contratará para que trabajes por los suyos\".</li>\r\n</ul>\r\nEsta frase es sin duda muy clara y directa, puedes ser un empleado más de alguien que si luchó y trabajó por sus sueños, o puedes ser tú quien luche por los suyos hasta que los haga realidad.\r\n<ul>\r\n 	<li>\"Solo una persona puede impedirte llegar muy alto y te mira todos los días desde el espejo\"</li>\r\n</ul>\r\nA veces nuestro peor enemigo somos nosotros mismos. Pero también somos nosotros mismos quienes decidimos qué pasará con nuestra vida más adelante, por lo que puedes irte por el camino fácil y destruir tú mismo tus sueños o puedes ponerte una meta muy clara y luchar día a día para llegar a ella.\r\n<ul>\r\n 	<li>\"Sé lo que tengo que hacer ahora, tengo que seguir respirando porque mañana el sol saldrá. ¿Quién sabe lo que podrá traer la marea?\" -Náufrago.</li>\r\n</ul>\r\nLa película de Náufrago es una clásica, tal vez no le dimos importancia a esta frase en su momento, pero ahora leyéndola, nos damos cuenta de que es muy cierta, el sol siempre saldrá, cada día es un nuevo comienzo, un paso más cerca a tu meta, por lo que tienes que \"seguir respirando\".\r\n\r\n<img class=\"size-full wp-image-336 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/059672.jpg-c_215_290_x-f_jpg-q_x-xxyxx.jpg\" alt=\"\" width=\"215\" height=\"290\" />\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>\"No dejes nunca que alguien te haga sentir como si no te merecieras lo que quieres\".-10 razones para odiarte.</li>\r\n</ul>\r\nEn el camino a tus metas, puedes encontrarte con personas que te van a cuestionar \"¿eres suficientemente bueno?¿lo lograrás?\". No debes nunca permitir que alguien te haga dudar de tus metas, por el contrario, persigue esa meta y pruebale que lo lograste. Así eventualmente dejarás de escucharlos pues sabes que lograrás lo que sea que te propongas.\r\n\r\n<img class=\"size-medium wp-image-337 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/jlXMEcAYOvu7s0QnWKE9q4P4pmN-689x1024-202x300.jpg\" alt=\"\" width=\"202\" height=\"300\" />\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>\"Si luchas, puedes perder. Si no luchas, ya has perdido\". –  Million Dollar Baby.</li>\r\n</ul>\r\nEl camino a tu meta no será fácil, tendrás muchos obstáculos que serán cada vez más difíciles de pasar, por lo que no te quedará más que luchar por lo que quieres cada día, y llegará un punto en el que pensarás en rendirte. Solo recuerda que si no luchas, habrás perdido ya la batalla al éxito.\r\n\r\n<img class=\"size-medium wp-image-338 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/f2956af4c64042690b4cecb57b98a736-210x300.jpg\" alt=\"\" width=\"210\" height=\"300\" />', 'Motivaciones', '', 'inherit', 'closed', 'closed', '', '335-revision-v1', '', '', '2019-11-06 03:07:41', '2019-11-06 03:07:41', '', 335, 'http://anneluresti.me/wp-blog2/?p=339', 0, 'revision', '', 0),
