(352, 1, '2019-11-06 16:03:51', '2019-11-06 16:03:51', '<span style=\"color: #ffffff;\">No cuento con muchos hobbies, pero los pocos que tengo los disfruto muchísimo.</span>\r\n\r\n<span style=\"color: #ffffff;\">El primero es la lectura. El primer libro que leí fue \"El diario de Ana Frank\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ahí cuando me gustó leer, aunque disfruté de el libro. Fue durante el primer año de secundaria que una amiga me prestó el libro de \"Bajo la misma estrella\". Ese libro me gustó muchísimo y fue así como entré al mundo de la lectura, de ese libro le siguieron muchos más, sobre todo novelas o libros de suspenso.</span>\r\n\r\n<span style=\"color: #ffffff;\">Entre mis libros favoritos están: La selección, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros más.</span>\r\n\r\n<span style=\"color: #ffffff;\">Yo no considero que debas leer un tipo de libro en específico, cualquier libro que desees leer es una buena opción ya que la lectura te trae muchos beneficios como reducción del estrés, estimulación de el razonamiento y la capacidad memorística de las personas, además de que te ayudará a ampliar tu vocabulario.</span>\r\n\r\n<span style=\"color: #ffffff;\">Orgullo y Prejuicio por ejemplo, para mí ha sido el libro más complicado que he leído, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconocía, además de expresiones un tanto extrañas que jamás había escuchado. Por lo que, para continuar con la lectura y comprenderla, tenía que investigar su significado, y es así como fui almacenando más palabras nuevas en mi vocabulario.</span>\r\n\r\n[gallery columns=\"4\" size=\"medium\" ids=\"327,328,329,330\"]\r\n\r\n&nbsp;\r\n\r\nEl segundo de mis hobbies, es el que más hago con demasiada frecuencia: escuchar música.\r\n\r\nEscucho música todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.\r\n\r\nActualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son London Boy, Paper Rings, Death By A Thousand Cuts, Cornelia Street y I Think He Knows.\r\n\r\n<img class=\"size-medium wp-image-331 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\r\n\r\n&nbsp;\r\n\r\nAdemás de las ya mencionadas canciones, otras de mis favoritas del momento son: Lose You To Love Me de Selena Gomez y Only Human de Jonas Brothers.\r\n\r\n&nbsp;\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-06 16:03:51', '2019-11-06 16:03:51', '', 326, 'http://anneluresti.me/wp-blog2/?p=352', 0, 'revision', '', 0),
