a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.</span>\r\n\r\n<span style=\"color: #ffffff;\">Actualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son London Boy, Paper Rings, Death By A Thousand Cuts, Cornelia Street y I Think He Knows.</span>\r\n\r\n<img class=\"size-medium wp-image-331 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Además de las ya mencionadas canciones, otras de mis favoritas del momento son: Lose You To Love Me de Selena Gomez y Only Human de Jonas Brothers.</span>\r\n\r\n&nbsp;\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-06 16:04:18', '2019-11-06 16:04:18', '', 326, 'http://anneluresti.me/wp-blog2/?p=353', 0, 'revision', '', 0),
(354, 1, '2019-11-06 16:04:59', '2019-11-06 16:04:59', '<span style=\"color: #ffffff;\">Además de la familia, a veces necesitas otro tipo de apoyo o motivación para seguir adelante en el camino. En mi caso hay varias frases que he escuchado en series o películas, así como leído en libros, que me motivan a no rendirme.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Si tú no trabajas por tus sueños, alguien te contratará para que trabajes por los suyos\".</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">Esta frase es sin duda muy clara y directa, puedes ser un empleado más de alguien que si luchó y trabajó por sus sueños, o puedes ser tú quien luche por los suyos hasta que los haga realidad.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Solo una persona puede impedirte llegar muy alto y te mira todos los días desde el espejo\"</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">A veces nuestro peor enemigo somos nosotros mismos. Pero también somos nosotros mismos quienes decidimos qué pasará con nuestra vida más adelante, por lo que puedes irte por el camino fácil y destruir tú mismo tus sueños o puedes ponerte una meta muy clara y luchar día a día para llegar a ella.</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Sé lo que tengo que hacer ahora, tengo que seguir respirando porque mañana el sol saldrá. ¿Quién sabe lo que podrá traer la marea?\" -Náufrago.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">La película de Náufrago es una clásica, tal vez no le dimos importancia a esta frase en su momento, pero ahora leyéndola, nos damos cuenta de que es muy cierta, el sol siempre saldrá, cada día es un nuevo comienzo, un paso más cerca a tu meta, por lo que tienes que \"seguir respirando\".</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-full wp-image-336 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/059672.jpg-c_215_290_x-f_jpg-q_x-xxyxx.jpg\" alt=\"\" width=\"215\" height=\"290\" /></span>\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"No dejes nunca que alguien te haga sentir como si no te merecieras lo que quieres\".-10 razones para odiarte.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">En el camino a tus metas, puedes encontrarte con personas que te van a cuestionar \"¿eres suficientemente bueno?¿lo lograrás?\". No debes nunca permitir que alguien te haga dudar de tus metas, por el contrario, persigue esa meta y pruebale que lo lograste. Así eventualmente dejarás de escucharlos pues sabes que lograrás lo que sea que te propongas.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-337 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/jlXMEcAYOvu7s0QnWKE9q4P4pmN-689x1024-202x300.jpg\" alt=\"\" width=\"202\" height=\"300\" /></span>\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\">\"Si luchas, puedes perder. Si no luchas, ya has perdido\". –  Million Dollar Baby.</span></li>\r\n</ul>\r\n<span style=\"color: #ffffff;\">El camino a tu meta no será fácil, tendrás muchos obstáculos que serán cada vez más difíciles de pasar, por lo que no te quedará más que luchar por lo que quieres cada día, y llegará un punto en el que pensarás en rendirte. Solo recuerda que si no luchas, habrás perdido ya la batalla al éxito.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-338 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/f2956af4c64042690b4cecb57b98a736-210x300.jpg\" alt=\"\" width=\"210\" height=\"300\" /></span>', 'Motivaciones', '', 'inherit', 'closed', 'closed', '', '335-revision-v1', '', '', '2019-11-06 16:04:59', '2019-11-06 16:04:59', '', 335, 'http://anneluresti.me/wp-blog2/?p=354', 0, 'revision', '', 0),
(355, 1, '2019-11-06 16:05:34', '2019-11-06 16:05:34', '<span style=\"color: #ffffff;\">Un factor de vital importancia para la creación de mi negocio de desarrollo de software fue mi familia. Yo soy la tercera hija de mis padres, Francisco Uresti y Laura Barrón. Mi hermano mayor se llama Gianfranco, a él le sigue mi hermana Daniela, después yo, y finalmente mi hermana menor Daneyla.</span>\r\n\r\n&nbsp;\r\n\r\n[gallery size=\"medium\" columns=\"2\" ids=\"312,313\"]\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Nunca fuimos muy cercanos a mis abuelas y a mi abuelo (mi abuelo por parte de mi papá falleció cuando el tenía 15 años), por lo que para mí, desde temprana edad siempre fuimos solamente nosotros seis como familia.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermano mayor Gianfranco actualmente está títulado como Ing. en Electrónica y reside desde hace más de un año en la ciudad de Monterrey, NL. Él es 7 años mayor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermana Daniela, está títulada como Ing. en Sistemas Computacionales y actualmente trabaja para Gobierno del Estado de Tamaulipas. Ella es 6 años mayor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Mi hermana Daneyla está cursando actualmente su último año de bachillerato en el CBTis 119. Ella es 1 año menor que yo.</span>\r\n\r\n<span style=\"color: #ffffff;\">Pero esta no es toda mi familia, para mí mi perro es parte de mi familia, ha estado con nosotros desde hace más de 6 años.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-314 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PicsArt_08-21-07.52.52-1-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" /></span>', 'Mi Familia', '', 'inherit', 'closed', 'closed', '', '311-revision-v1', '', '', '2019-11-06 16:05:34', '2019-11-06 16:05:34', '', 311, 'http://anneluresti.me/wp-blog2/?p=355', 0, 'revision', '', 0),
(356, 1, '2019-11-06 16:06:12', '2019-11-06 16:06:12', '<span style=\"color: #ffffff;\">Desde muy pequeña aprendí a ser <strong>rápida</strong>, que considero es una muy buena habilidad hoy en día. Ya que un cliente nos pide un proyecto con ciertas características y tenemos que saber administrar nuestro tiempo para poder terminar el trabajo antes de la entrega y poder hacer los últimos retoques y finalmente estregar un buen trabajo, bonito y con las características que nos fue solicitado.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-308 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/1542110228379_1-300x173.jpg\" alt=\"\" width=\"300\" height=\"173\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Otra de las habilidades que considero me son de beneficio en este negocio es el<strong> trabajo en equipo</strong>. Yo no podría hacer esto sin mi equipo respaldándome. Por eso es importante tener un buen compañerismo entre todos los que somos parte de este equipo.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-306 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/como-puede-contribuir-la-tecnologia-al-trabajo-en-equipo--300x147.jpg\" alt=\"\" width=\"300\" height=\"147\" /></span>\r\n\r\n<span style=\"color: #ffffff;\">Cualquier negocio fallaría si no se tiene <strong>organización</strong><strong>. </strong>Esta habilidad la desarrollé a lo largo de los años, sobre todo en proyectos escolares, en los que te dicen el proyecto esperado y la fecha de entrega, por lo que se tiene que organizar el avance con el tiempo que resta para entregar.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-307 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/linkedin-cv-874x492-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" /></span>', 'Mis habilidades', '', 'inherit', 'closed', 'closed', '', '294-revision-v1', '', '', '2019-11-06 16:06:12', '2019-11-06 16:06:12', '', 294, 'http://anneluresti.me/wp-blog2/?p=356', 0, 'revision', '', 0),
(357, 1, '2019-11-06 16:07:05', '2019-11-06 16:07:05', '<span style=\"color: #ffffff;\">Yo tuve una gran educación desde el momento en que ingresé a nivel básico. A la edad de 3 años ingrese al Jardín de Niños \"Decroly\" en el que me enseñaron básicamente todo, leer, escribir y un poco de matemáticas básicas. La razón por la que ingresé a este jardín fue porque mis hermanos ya habían estado allí por lo que mi mamá conocía la manera en que enseñaban, y estaba feliz con los conocimientos que adquirieron mis hermanos durante su paso por el jardín.</span>\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"317,318\"]\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">En el año 2007 ingresé a la Primaria República de Chile, otra excelente escuela. Al ser una escuela de pocos alumnos, se tiene una educación más personalizada. Habían muchos excelentes maestros de los que todavía recuerdo con cariño, entre ellos al profesor Marco y la maestra Norma quienes sin duda amaban ser maestros y a sus alumnos. Nuevamente mi ingreso a esta escuela fue marcado por el previo conocimiento de mi mamá, de la escuela y sus maestros.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-319 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/20191105_152909-e1573009159782-300x203.jpg\" alt=\"\" width=\"300\" height=\"203\" /></span>\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">En 2013 ingresé a la secundaria Técnica No.1 \"Álvaro Obregón\". En este caso, solo mi hermano estudió aquí y me aconsejo que yo también debería de entrar allí ya que era una muy buena escuela. Y así lo hice, aunque nos quedaba más lejos que otras secundarias, mis papás me apoyaron en mi decisión de presentar en esa secundaria. Ingresé finalmente, en el turno matutino.</span>\r\n\r\n<span style=\"color: #ffffff;\"><img class=\"size-medium wp-image-320 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/20191105_172405-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" /></span>\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Así llegamos al año 2016, cuando finalmente ingresé al CBTis 271 que aunque no había sido mi primera opción estoy muy agradecida de que ingresé allí y no a otro. En este CBTis encontré a las que considero mis verdaderas amigas, como lo fuimos desde primer semestre hasta sexto. En él también nos encontramos con maestros que más que eso, eran amigos y nos apoyaban en todo. Sin duda la mejor época de mi vida.</span>\r\n\r\n[gallery columns=\"4\" size=\"medium\" ids=\"321,322,323,324\"]', 'Mis Estudios', '', 'inherit', 'closed', 'closed', '', '316-revision-v1', '', '', '2019-11-06 16:07:05', '2019-11-06 16:07:05', '', 316, 'http://anneluresti.me/wp-blog2/?p=357', 0, 'revision', '', 0),
