(370, 1, '2019-11-14 22:48:16', '2019-11-14 22:48:16', 'Este es un espacio para que me puedas enviar todas tus dudas o aclaraciones, será un placer atenderte!		\n			<h2>CONTÁCTANOS</h2>		\n			<h2>\nCONTÁCTAME!</h2>		\n		<p><strong>Este es un espacio en el que podrás enviarme cualquier duda o aclaración y con gusto te atenderé lo más pronto posible! </strong></p>		\n										<img width=\"300\" height=\"118\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/contactanos-2000x789-300x118.png\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/contactanos-2000x789-300x118.png 300w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/contactanos-2000x789-768x303.png 768w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/contactanos-2000x789-1024x404.png 1024w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n                	            <!--  /.icon -->\n                <h3>Correo</h3><!--  /.info-title -->\n                <p>anneluresti@gmail.com</p>\n            <!--  /.details -->\n        <!--  /.contact-item -->\n                	            <!--  /.icon -->\n                <h3>Teléfono</h3><!--  /.info-title -->\n                <p>(+052) 834-352-51-57</p>\n            <!--  /.details -->\n        <!--  /.contact-item -->\n                	            <!--  /.icon -->\n                <h3>Dirección</h3><!--  /.info-title -->\n                <p>Calle Montes Urales 445, Lomas - Virreyes, Lomas de Chapultepec, Miguel Hidalgo, 11000 Ciudad de México, CDMX</p>\n            <!--  /.details -->\n        <!--  /.contact-item -->\n		<p><strong>Puedes también contactarte con mi equipo en caso de necesitar una respuesta más rápida, solo necesitas llenar los siguientes campos.</strong></p>		\n<form action=\"/wp-blog2/wp-admin/admin-ajax.php#wpcf7-f6-o1\" method=\"post\" novalidate=\"novalidate\">\n<input type=\"hidden\" name=\"_wpcf7\" value=\"6\" />\n<input type=\"hidden\" name=\"_wpcf7_version\" value=\"5.1.