(409, 1, '2019-11-15 00:23:04', '2019-11-15 00:23:04', '<div class=\"vc_row wpb_row vc_row-fluid vc_custom_1463976570197\">\r\n<div class=\"wpb_column vc_column_container vc_col-sm-12 vc_hidden-sm vc_hidden-xs\">\r\n<div class=\"vc_column-inner\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_tour wpb_content_element tab-style-four\" data-interval=\"0\">\r\n<div class=\"wpb_wrapper wpb_tour_tabs_wrapper ui-tabs vc_clearfix ui-widget ui-widget-content ui-corner-all\">\r\n<div id=\"tab-1381346746-2-31\" class=\"wpb_tab ui-tabs-panel wpb_ui-tabs-hide vc_clearfix ui-widget-content ui-corner-bottom\" role=\"tabpanel\" aria-labelledby=\"ui-id-1\" aria-hidden=\"false\">\r\n<div class=\"wpb_text_column wpb_content_element \">\r\n<div class=\"wpb_wrapper\">\r\n\r\n<span style=\"color: #ffffff;\"><strong>Diseño de sitios web</strong> y <strong>Desarrollo web</strong> corporativo con la intención de que nuestras <strong>páginas web</strong> sean la mejor carta de presentación y la principal herramienta para generar ventas.</span>\r\n\r\n<span style=\"color: #ffffff;\">Integramos diferentes aplicaciones de<strong> desarrollo web</strong> a través de programación, maquetación y análisis del sitio. Además desarrollamos páginas web a la medida, aplicaciones Móviles, CRM, Software o software a la medida.</span>\r\n\r\n<span style=\"color: #ffffff;\">Cada <strong>página web</strong> está enfocada en incrementar ventas en Internet. Utilizamos los lenguajes de programación más importantes:</span>\r\n<ul>\r\n 	<li><span style=\"color: #ffffff;\"><strong>Lenguajes de Programación: </strong>HTML5 , CSS, <strong>PHP</strong>, MySQL, JavaScript.</span></li>\r\n 	<li><span style=\"color: #ffffff;\"><strong>Plataformas: </strong>WordPress,  Joomla , Magento.</span></li>\r\n 	<li><span style=\"color: #ffffff;\"><strong>Frameworks: </strong>Bootstrap, Boilerplate, Foundation, <strong>CakePHP</strong>, CodeIgniter, Zend<strong>, jQuery,</strong> Mootools.</span></li>\r\n</ul>\r\n</div>\r\n