(419, 1, '2019-11-15 01:03:05', '2019-11-15 01:03:05', '<!--  /.horizontal-border -->\n		            			            			                <h2>Ing. Tecnologías de la Información</h2>\n		            			            			                <h2>Annel Uresti</h2><!--  /.hero-title -->\n		            			            			                <ul>\n		                			                		<li>Diseño Web </li>\n		                			                		<li>Desarrollo Web </li>\n		                			                </ul><!--  /.hero-designation -->\n		            			                <a href=\"https://www.youtube.com/watch?v=WqWv_mpuvaI\">\n		                    Acerca nuestros servicios\n		                </a>\n		            			            <!--  /.col-lg-8 -->\n		        <!--  /.row -->\n			<!--  /.container-xl -->\n		    			        <!--  /.hg-background-image -->\n		    			    <!--  /.hg-background -->\n		<!--  /.hero-block -->\n			            <h2>01</h2><!--  /.title-counter -->\n        	        	            <h2>Servicios</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n		            			            <!--  /.service-icon -->\n		            		            <h2>Diseño Web</h2><!--  /.service-title -->\n		                	<p>Diseño, implementación y mantenimiento de sitios web.  ¡Haz que tu sitio web sea el menor!</p>\n		            	<!--  /.service-content -->\n		            		<p>Una buena visualización de la página, sencilla, útil y eficaz que facilite la navegación de los posibles clientes y haga su visita agradable con un contenido de calidad, potenciará en ellos la necesidad de volver y consumir tus productos.</p>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n		            			            <!--  /.service-icon -->\n		            		            <h2>Desarrollo Web</h2><!--  /.service-title -->\n		                	<p>Desarrollo web significa construir sitios web y va de la mano con un buen diseño web.</p>\n		            	<!--  /.service-content -->\n		            		<p>Es el trabajo que tiene lugar en un segundo plano y que permite que una web tenga una apariencia impecable, un funcionamiento rápido y un buen desempeño para permitir la mejor experiencia de usuario.</p>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n					<!--  /.owl-carousel -->\n			            <h2>02</h2><!--  /.title-counter -->\n        	        	            <h2>Acerca de mí</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n			<h2>Annel Uresti</h2>		\n		<p>Mis conocimientos los adquirí desde la secundaria, con los temas más básicos de la informática y de ahí en adelante seguí con la programación en en nivel medio superior y finalmente adquirí mi título como Ing. en Tecnologías de la Información en la Universidad Politécnica de Victoria.</p>		\n			<a href=\"http://anneluresti.me/wp-blog2/?page_id=285\" role=\"button\">\n						Ver más...\n					</a>\n		        <h4>\n		        			            Estrategia\n		                    94%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Marketing\n		                    85%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Diseño\n		                    88%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Desarrollo\n		                    90%\n		        </h4>\n		    <!-- /.skill-bar -->\n										<img width=\"1008\" height=\"720\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-1.jpg\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-1.jpg 1008w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-1-300x214.jpg 300w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-1-768x549.jpg 768w\" sizes=\"(max-width: 1008px) 100vw, 1008px\" />											\n					        0\n					        <h4>Cliente feliz</h4>\n					    <!--end ts-promo-number-->\n					        0\n					        <h4>Años de experiencia</h4>\n					    <!--end ts-promo-number-->\n					        0\n					        <h4>Premios ganados</h4>\n					    <!--end ts-promo-number-->\n					        0\n					        <h4>Proyectos completos</h4>\n					    <!--end ts-promo-number-->\n			<!--  /.hg-promo-numbers -->\n	        		            <h2>Trabajemos en tus próximos proyectos</h2><!--  /.call-to-title -->\n	            	            	            	            <a href=\"\"  target=\"_blank\"  rel=\"nofollow noopener noreferrer\">Contrátame!</a>\n	            	        <!--  /.container -->\n	            <!--  /.hg-background-image -->\n	        <!--  /.hg-background -->\n	    <!--  /.our-work-step -->\n			            <h2>03</h2><!--  /.title-counter -->\n        	        	            <h2>Conoce a nuestro equipo</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n				<figure><img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190623_091751_238-1-300x225.jpg\" alt=\"IMG_20190623_091751_238\" /></figure><figure><img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190206_200404655-300x230.jpg\" alt=\"PhotoEditor_20190206_200404655\" /></figure><figure><img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190315_154344-225x300.jpg\" alt=\"IMG_20190315_154344\" /></figure><figure><img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20180825_152838-225x300.jpg\" alt=\"IMG_20180825_152838\" /></figure><figure><img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190330_211651_231-300x300.jpg\" alt=\"IMG_20190330_211651_231\" /></figure>			\n						Previous\n						Next\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n									</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Google-plus\n									</a>\n			            <h2>04</h2><!--  /.title-counter -->\n        	        	            <h2>Testimonio</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n		<!-- Content Row -->\n		                        <img src=\"http://intrinsic.softhopper.net/wp-content/uploads/2019/01/client-1.png\" alt=\"Alfredo López\" />\n		                    <!--  /.client-thumb -->\n		                                <h4>Alfredo López</h4><!--  /.client-name -->\n		                            <!--  /.client-detail -->\n		                        			                        <!--  /.client-area -->\n		                            <p>He trabajado con Annel y su equipo cerca de un año con varios proyectos diferentes y la recomiendo ampliamente.</p>		                        <!--  /.details -->\n		                    			                    <!--  /.testimonial-details -->\n		                <!--  /.client-testimonial -->\n		            <!--  /.item -->\n		                        <img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/esme-100x100.jpg\" alt=\"Esmeralda Arjona\" />\n		                    <!--  /.client-thumb -->\n		                                <h4>Esmeralda Arjona</h4><!--  /.client-name -->\n		                            <!--  /.client-detail -->\n		                        			                        <!--  /.client-area -->\n		                            <p>Annel y su equipo, siempre son mi primera opción para casi cualquier proyecto que desee realizar.</p>		                        <!--  /.details -->\n		                    			                    <!--  /.testimonial-details -->\n		                <!--  /.client-testimonial -->\n		            <!--  /.item -->\n		                        <img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/pic32-100x100.jpg\" alt=\"Gianfranco Cardona\" />\n		                    <!--  /.client-thumb -->\n		                                <h4>Gianfranco Cardona</h4><!--  /.client-name -->\n		                            <!--  /.client-detail -->\n		                        			                        <!--  /.client-area -->\n		                            <p>Su equipo y ella me han demostrado que son profesionales, cumplen en tiempo y forma siempre.</p>		                        <!--  /.details -->\n		                    			                    <!--  /.testimonial-details -->\n		                <!--  /.client-testimonial -->\n		            <!--  /.item -->\n		        <!--  /.owl-carousel -->\n		    <!--  /.col-md-10 -->\n		<!--  /.row -->\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"96\" height=\"97\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/01/logo-1.png\" alt=\"\" />								</a>\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"150\" height=\"150\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png 150w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200.png 200w\" sizes=\"(max-width: 150px) 100vw, 150px\" />								</a>\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"150\" height=\"150\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/a58fb97c-2b4e-4135-8aac-cd2509dbcfb1_200x200-150x150.png\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/a58fb97c-2b4e-4135-8aac-cd2509dbcfb1_200x200-150x150.png 150w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/a58fb97c-2b4e-4135-8aac-cd2509dbcfb1_200x200.png 200w\" sizes=\"(max-width: 150px) 100vw, 150px\" />								</a>\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"150\" height=\"150\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200-150x150.png 150w, http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/d0ea199d-ca8e-4c5e-8f97-5937d9dc38d7_200x200.png 200w\" sizes=\"(max-width: 150px) 100vw, 150px\" />								</a>\n											<a href=\"#\" data-elementor-open-lightbox=\"\">\n							<img width=\"87\" height=\"86\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/01/logo-5.png\" alt=\"\" />								</a>\n			            <h2>05</h2><!--  /.title-counter -->\n        	        	            <h2>Ubicación de nuestra empresa</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=Universidad%20Polit%C3%A9cnica%20de%20Victoria%2C%20Ciudad%20Victoria%2C%20Tamaulipas%2C%20M%C3%A9xico&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"Universidad Politécnica de Victoria, Ciudad Victoria, Tamaulipas, México\"></iframe>		\n			<a href=\"http://anneluresti.me/wp-blog2019/\" role=\"button\">\n						Ir a la versión Light\n					</a>', 'Home Dark', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2019-11-15 01:03:05', '2019-11-15 01:03:05', '', 55, 'http://anneluresti.me/wp-blog2/?p=419', 0, 'revision', '', 0),
(420, 1, '2019-11-15 01:14:31', '2019-11-15 01:14:31', '<span style=\"color: #ffffff;\">Mi nombre es Annel Fernanda Uresti Barrón, nací y crecí en Cd. Victoria, Tamaulipas. Mi primer contacto con los temas relacionados a la programación, fue en primero de secundaria, en el taller de Informática en el que estuve 3 años y después estudié Programación en mi educación media superior,  con un enfoque más claro a seguir con la Programación. Actualmente estudio en la Universidad Politécnica de Victoria en la carrera de Ing. en Tecnologías de la Información.</span>\r\n\r\n<span style=\"color: #ffffff;\">Para saber más sobre mí, como mis gustos y mi familia, puedes dirigirte al menú superior del lado derecho, llamado \"Acerca de mí\" y escoger el tema de tu interés.</span>\r\n\r\n&nbsp;\r\n\r\n<img class=\"aligncenter wp-image-288 size-medium\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/IMG_20190315_154306-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" />', 'Acerca de mí', '', 'inherit', 'closed', 'closed', '', '285-revision-v1', '', '', '2019-11-15 01:14:31', '2019-11-15 01:14:31', '', 285, 'http://anneluresti.me/wp-blog2/?p=420', 0, 'revision', '', 0),
