(423, 1, '2019-11-15 01:38:01', '2019-11-15 01:38:01', '<span style=\"color: #ffffff;\">No cuento con muchos hobbies, pero los pocos que tengo los disfruto muchísimo.</span>\r\n\r\n<span style=\"color: #ffffff;\">El primero es la lectura. El primer libro que leí fue \"El diario de Ana Frank\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ahí cuando me gustó leer, aunque disfruté de el libro. Fue durante el primer año de secundaria que una amiga me prestó el libro de \"Bajo la misma estrella\". Ese libro me gustó muchísimo y fue así como entré al mundo de la lectura, de ese libro le siguieron muchos más, sobre todo novelas o libros de suspenso.</span>\r\n\r\n<span style=\"color: #ffffff;\">Entre mis libros favoritos están: La selección, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros más.</span>\r\n\r\n<span style=\"color: #ffffff;\">Yo no considero que debas leer un tipo de libro en específico, cualquier libro que desees leer es una buena opción ya que la lectura te trae muchos beneficios como reducción del estrés, estimulación de el razonamiento y la capacidad memorística de las personas, además de que te ayudará a ampliar tu vocabulario.</span>\r\n\r\n<span style=\"color: #ffffff;\">Orgullo y Prejuicio por ejemplo, para mí ha sido el libro más complicado que he leído, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconocía, además de expresiones un tanto extrañas que jamás había escuchado. Por lo que, para continuar con la lectura y comprenderla, tenía que investigar su significado, y es así como fui almacenando más palabras nuevas en mi vocabulario.</span>\r\n\r\n[gallery columns=\"4\" size=\"medium\" ids=\"327,328,329,330\"]\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">El segundo de mis hobbies, es el que más hago con demasiada frecuencia: escuchar música.</span>\r\n\r\n<span style=\"color: #ffffff;\">Escucho música todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.</span>\r\n\r\n<span style=\"color: #ffffff;\">Actualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VsKoOH6DVys\">London Boy</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=8zdg-pDF10g\">Paper Rings</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=GTEFSuFfgnU\">Death By A Thousand Cuts</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VikHHWrgb4Y\">Cornelia Street</a> y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=2d1wKn-oJnA\">I Think He Knows</a>.</span>\r\n\r\n<img class=\"size-medium wp-image-331 aligncenter\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #ffffff;\">Además de las ya mencionadas canciones, otras de mis favoritas del momento son:<a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=zlJDTxahav0\"> Lose You To Love Me</a> de Selena Gomez y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=EQ51hgSxEaI\">Only Human</a> de Jonas Brothers.</span>\r\n\r\n&nbsp;\r\n\r\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-15 01:38:01', '2019-11-15 01:38:01', '', 326, 'http://anneluresti.me/wp-blog2/?p=423', 0, 'revision', '', 0),
(424, 1, '2019-11-15 01:41:33', '2019-11-15 01:41:33', 'No cuento con muchos hobbies, pero los pocos que tengo los disfruto muchísimo.\nEl primero es la lectura. El primer libro que leí fue \"El diario de Ana Frank\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ahí cuando me gustó leer, aunque disfruté de el libro. Fue durante el primer año de secundaria que una amiga me prestó el libro de \"Bajo la misma estrella\". Ese libro me gustó muchísimo y fue así como entré al mundo de la lectura, de ese libro le siguieron muchos más, sobre todo novelas o libros de suspenso.\nEntre mis libros favoritos están: La selección, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros más.\nYo no considero que debas leer un tipo de libro en específico, cualquier libro que desees leer es una buena opción ya que la lectura te trae muchos beneficios como reducción del estrés, estimulación de el razonamiento y la capacidad memorística de las personas, además de que te ayudará a ampliar tu vocabulario.\nOrgullo y Prejuicio por ejemplo, para mí ha sido el libro más complicado que he leído, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconocía, además de expresiones un tanto extrañas que jamás había escuchado. Por lo que, para continuar con la lectura y comprenderla, tenía que investigar su significado, y es así como fui almacenando más palabras nuevas en mi vocabulario.\n[gallery columns=\"4\" size=\"medium\" ids=\"327,328,329,330\"]\n&nbsp;\nEl segundo de mis hobbies, es el que más hago con demasiada frecuencia: escuchar música.\nEscucho música todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.\nActualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VsKoOH6DVys\">London Boy</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=8zdg-pDF10g\">Paper Rings</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=GTEFSuFfgnU\">Death By A Thousand Cuts</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VikHHWrgb4Y\">Cornelia Street</a> y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=2d1wKn-oJnA\">I Think He Knows</a>.\n<img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\n&nbsp;\nAdemás de las ya mencionadas canciones, otras de mis favoritas del momento son:<a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=zlJDTxahav0\"> Lose You To Love Me</a> de Selena Gomez y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=EQ51hgSxEaI\">Only Human</a> de Jonas Brothers.\n&nbsp;\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]\n&nbsp;\n&nbsp;https://www.youtube.com/watch?v=eIRCskNRTDY', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-15 01:41:33', '2019-11-15 01:41:33', '', 326, 'http://anneluresti.me/wp-blog2/?p=424', 0, 'revision', '', 0),
(425, 1, '2019-11-15 01:42:56', '2019-11-15 01:42:56', 'No cuento con muchos hobbies, pero los pocos que tengo los disfruto muchísimo.\nEl primero es la lectura. El primer libro que leí fue \"El diario de Ana Frank\", porque era un requisito que nos fue pedido al entrar a la secundaria, no fue ahí cuando me gustó leer, aunque disfruté de el libro. Fue durante el primer año de secundaria que una amiga me prestó el libro de \"Bajo la misma estrella\". Ese libro me gustó muchísimo y fue así como entré al mundo de la lectura, de ese libro le siguieron muchos más, sobre todo novelas o libros de suspenso.\nEntre mis libros favoritos están: La selección, Nunca Nunca, Hielo Negro, Orgullo y Prejuicio, y muchos otros más.\nYo no considero que debas leer un tipo de libro en específico, cualquier libro que desees leer es una buena opción ya que la lectura te trae muchos beneficios como reducción del estrés, estimulación de el razonamiento y la capacidad memorística de las personas, además de que te ayudará a ampliar tu vocabulario.\nOrgullo y Prejuicio por ejemplo, para mí ha sido el libro más complicado que he leído, ya que al ser un libro viejo (de 1813), tiene muchas palabras que yo desconocía, además de expresiones un tanto extrañas que jamás había escuchado. Por lo que, para continuar con la lectura y comprenderla, tenía que investigar su significado, y es así como fui almacenando más palabras nuevas en mi vocabulario.\n[gallery columns=\"4\" size=\"medium\" ids=\"327,328,329,330\"]\n&nbsp;\nEl segundo de mis hobbies, es el que más hago con demasiada frecuencia: escuchar música.\nEscucho música todo el tiempo, tanto en el carro de camino a la escuela y de regreso a mi casa, al estar haciendo tarea o en cualquier tiempo que pueda.\nActualmente disfruto de un álbum en específico, Lover de Taylor Swift. Todas las canciones de ese álbum las disfruto mucho pero hay 5 que tengo siempre on-repeat. Esas son <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VsKoOH6DVys\">London Boy</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=8zdg-pDF10g\">Paper Rings</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=GTEFSuFfgnU\">Death By A Thousand Cuts</a>, <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=VikHHWrgb4Y\">Cornelia Street</a> y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=2d1wKn-oJnA\">I Think He Knows</a>.\n<img src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/602577928680-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\n&nbsp;\nAdemás de las ya mencionadas canciones, otras de mis favoritas del momento son:<a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=zlJDTxahav0\"> Lose You To Love Me</a> de Selena Gomez y <a style=\"color: #ffffff;\" href=\"https://www.youtube.com/watch?v=EQ51hgSxEaI\">Only Human</a> de Jonas Brothers.\n&nbsp;\n[gallery columns=\"2\" size=\"medium\" ids=\"332,333\"]\n&nbsp;\n&nbsp;<p><strong>El siguiente video es una presentación de mi artista favorita, Taylor Swift, espero sea de tu agrado!</strong></p>https://www.youtube.com/watch?v=eIRCskNRTDY', 'Mis Hobbies', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2019-11-15 01:42:56', '2019-11-15 01:42:56', '', 326, 'http://anneluresti.me/wp-blog2/?p=425', 0, 'revision', '', 0),
