(439, 1, '2019-11-15 02:12:25', '2019-11-15 02:12:25', '<!--  /.horizontal-border -->\n		            			            			                <h2>Ing. Tecnologías de la Información</h2>\n		            			            			                <h2>Annel Uresti</h2><!--  /.hero-title -->\n		            			            			                <ul>\n		                			                		<li>Diseño Web </li>\n		                			                		<li>Desarrollo Web </li>\n		                			                </ul><!--  /.hero-designation -->\n		            			                <a href=\"https://www.youtube.com/watch?v=WqWv_mpuvaI\">\n		                    Acerca nuestros servicios\n		                </a>\n		            			            <!--  /.col-lg-8 -->\n		        <!--  /.row -->\n			<!--  /.container-xl -->\n		    			        <!--  /.hg-background-image -->\n		    			    <!--  /.hg-background -->\n		<!--  /.hero-block -->\n			            <h2>01</h2><!--  /.title-counter -->\n        	        	            <h2>Servicios</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n		            			            <!--  /.service-icon -->\n		            		            <h2>Diseño Web</h2><!--  /.service-title -->\n		                	<p>Diseño, implementación y mantenimiento de sitios web.  ¡Haz que tu sitio web sea el menor!</p>\n		            	<!--  /.service-content -->\n		            		<p>Una buena visualización de la página, sencilla, útil y eficaz que facilite la navegación de los posibles clientes y haga su visita agradable con un contenido de calidad, potenciará en ellos la necesidad de volver y consumir tus productos.</p>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n		            			            <!--  /.service-icon -->\n		            		            <h2>Desarrollo Web</h2><!--  /.service-title -->\n		                	<p>Desarrollo web significa construir sitios web y va de la mano con un buen diseño web.</p>\n		            	<!--  /.service-content -->\n		            		<p>Es el trabajo que tiene lugar en un segundo plano y que permite que una web tenga una apariencia impecable, un funcionamiento rápido y un buen desempeño para permitir la mejor experiencia de usuario.</p>		            	<!--  /.service-hover-content -->\n		            			            <!--  /.service-list -->\n	            				            <!--  /.shadow-icon -->\n		        <!--  /.service-card -->\n		    <!--  /.item -->                                       \n					<!--  /.owl-carousel -->\n			            <h2>02</h2><!--  /.title-counter -->\n        	        	            <h2>Acerca de mí</h2><!-- /.title-main -->\n            <!--  /.title-border -->\n			<h2>Annel Uresti</h2>		\n		<p>Mis conocimientos los adquirí desde la secundaria, con los temas más básicos de la informática y de ahí en adelante seguí con la programación en en nivel medio superior y finalmente adquirí mi título como Ing. en Tecnologías de la Información en la Universidad Politécnica de Victoria.</p>		\n			<a href=\"http://anneluresti.me/wp-blog2/?page_id=285\" role=\"button\">\n						Ver más...\n					</a>\n		        <h4>\n		        			            Estrategia\n		                    94%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Marketing\n		                    85%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Diseño\n		                    88%\n		        </h4>\n		    <!-- /.skill-bar -->\n		        <h4>\n		        			            Desarrollo\n		                    90%\n		        </h4>\n		    <!-- /.skill-bar -->\n										<img width=\"1008\" height=\"720\" src=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11/PhotoEditor_20190315_161310623-1.jpg\" alt=\"\" srcset=\"http://anneluresti.me/wp-blog2/wp-content/uploads/2019/11